import React, {memo} from 'react';
import styled from 'styled-components';

const BannerContentContainer = styled.div`
    width:100%;
    margin-top:60px;
    text-align: center;

    .contentWrap{
        .supContentWrap{
            padding-top:60px;
            max-width: 1200px;
            height:480px;
            background-color: #f9f9f9;
            margin:0 auto;

            .supConTitle{
                    font-size:30px;
                    font-weight: 700;
                }

                .supContxt{
                    font-size:16px;
                    margin-top:10px;
                    color:#959595;
                }

            .supContentInner{
                
            }
        }
    }

    
`;

const BannerContent = memo(() => {
    return (
        <BannerContentContainer>
            <div className='contentWrap'>
                <div className='supContentWrap'>
                    <h1 className='supConTitle'>신청 중인 지원 사업</h1>
                    <p className='supContxt'>현재 접수 중인 지원 사업에 대해 알아보세요.</p>
                    <div className='supContentInner'></div>
                </div>
            </div>
        </BannerContentContainer>
    );
});

export default BannerContent;
